import React, { useState, useEffect } from 'react';
import * as api from '../library/api';
import * as ultility from '../library/ultility';

function Navbar({ isOpen }) {
    const [open, setOpen] = useState(true)
    const ToggleMobileNavbar = () => {
        setOpen(!open);
        isOpen(open);
    }
    useEffect(() => {
        ToggleMobileNavbar();
    }, [])
    const Logout = () => {
        api.Post("/Logout/", null, function (response) {
            if (response) {
                ultility.DeleteCookie("user");
                window.location.href = '/Login'
            }
        });
    }
    return (
        <>
            <nav className="navbar navbar-expand-lg">
                <div className="container-fluid d-flex align-items-center justify-content-between">
                    <div className="">
                        <i className={open ? "burger open" : "burger"} onClick={ToggleMobileNavbar}>
                            <span></span>
                            <span></span>
                            <span></span>
                        </i>
                    </div>
                    <div className="navbar-header">
                    </div>
                    <div className="right-menu list-inline no-margin-bottom">
                        <div className="list-inline-item dropdown">
                            <a href="/#" data-target="#" data-toggle="dropdown" className="nav-link language dropdown-toggle">
                                <span className="d-none d-sm-inline-block">English</span>
                            </a>
                        </div>
                    </div>
                    <div aria-labelledby="languages" class="dropdown-menu" style="display: none;">
                        <a rel="nofollow" href="#" class="dropdown-item">
                            <img src="img/flags/16/DE.png" alt="English" class="mr-2" /><span>German</span>
                        </a>
                        <a rel="nofollow" href="#" class="dropdown-item"> <img src="img/flags/16/FR.png" alt="English" class="mr-2" /><span>French </span>
                        </a>
                    </div>
                </div>
            </nav>
        </>
    );
}

export default Navbar;
